INSERT INTO `server_motd` (`id`, `world_id`, `text`) VALUES
(1, 0, 'Welcome to The Forgotten Server!'),
(2, 0, 'Bem Vindos Ao Keltera-Global Server!'),
(3, 0, 'Welcome to Time Travel Open Tibia Server!'),
(4, 0, 'Bem vindo ao Time Travel, estamos em período de testes até 31/01/2013, por favor avise os bugs que encontrar em nossa ouvidoria.'),
(5, 0, 'Todos os personagens foram deletados dia 03/02/2013 devido ao excesso de bugs durante o lençamento do servidor.'),
(6, 0, 'Nosso servidor ficou offline durante a tarde de 07/02/2013 devido a troca de nosso hoster. Esperamos que isso encerre o lag no jogo.'),
(7, 0, 'Evento de carnaval! Servidor em super speed! Todos players vão ficar com um dia e meio com super speed!'),
(8, 0, 'Hoje (evento de carnaval) cada player esta com 5.000 de velocidade, amanhã (terça), a velocidade do servidor será alterada para 4.000.'),
(9, 0, 'Aproveite o evento de carnaval: essa semana todos os players estão com super velocidade!'),
(10, 0, 'O evento de super velocidade acaba esta sexta-feira à noite!'),
(11, 0, 'O ml e skills do ot foram aumentados! E durante este final se semana estamos em evento de double loot.'),
(12, 0, 'Seja bem vindo ao Time Travel!.'),
(13, 0, 'Até dia 28 deste mês o Lord Azzi não terá como ficar on no OT Server por estar fazendo um curso intensivo em seu emprego. Bom jogo!'),
(14, 0, 'Seja bem vindo ao Time Travel! Tenham um bom jogo!'),
(15, 0, 'O nome de alguns players foram alterados por infringirem as regras. Bom jogo!'),
(16, 0, 'Infelizmente o servidor está sem recurso capital para se manter online e deverá fechar as portas em abril. Agradecemos os que jogaram!');
